doc:
This command compares two strings and is similar to strcmp in C.

Return Values:
	>0  : String 1 > String 2
	0  : Strings are equal
	<0 : String 1 < String 2

Examples:
	.@a = strcmp("abcdef", "ABCDEF");
	if (.@a > 0){
		mes(".@a is greater than 0."); //Output is this.
	} else {
		mes(".@a is less or equal to 0");
	}
